import React, { useEffect, useState } from "react"

const App = () => {
  const [users, setUsers] = useState([])
  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/users")
      .then((response) => response.json())
      .then((json) => console.log(json))
  }, [])
  return (
    <div>
      <h1>User</h1>
      <div className='card'>
        {users.map((user) => (
          <div className='card-inner'>
            <p>{user.name}</p>
            <p>{user.email}</p>
            <p>Username</p>
          </div>
        ))}
      </div>
    </div>
  )
}

export default App
